import './App.css';
import kra from '../src/kra.png';
import {Row,Col} from 'antd';

function App() {
  return (
    <div className="App">
        <Row>
        <Col span={4}>
          <img  src={kra} alt=""></img>
        </Col>
        <Col span={20} >
          <marquee>
            <div  ><span >Gold 24KT - RS.5677.20 Per Gm</span></div>
            <div  ><span >Gold 24KT - RS.5283.70 Per Gm</span></div>
            <div  >< >Gold 24KT - RS.4496.80 Per Gm</></div>
            <div  ><p >Pune Sliver - Rs.6680 per Gm</p></div>
          </marquee>
        </Col>
        </Row>
    </div>
  );
}

export default App;
